import React from "react";
import TopCustomStyle from "./top.module.css";
import "bootstrap/dist/css/bootstrap.min.css";
import {
  Navbar,
  Nav,
  NavItem,
  NavDropdown,
  MenuItem,
  Container,
  Button,
} from "react-bootstrap";

const Top = () => {
  return (
    <div className={TopCustomStyle.body}>
      <div classNameName={TopCustomStyle.content}>
        <header></header>
        {/* <div className={TopCustomStyle.start}>
          <div className={TopCustomStyle.start_image}>
            <img src="images/hello.jpeg" />
          </div>
        </div> */}
        <div className="content-part">
          <Container fluid className={TopCustomStyle.first_block}>
            <div className={`${TopCustomStyle.first_block} row mt-5`}>
              <div
                className={`${TopCustomStyle.first_content_img} col-12 col-lg-12 col-md-12 col-sm-12`}
              >
                <div
                  className={
                    (`${TopCustomStyle.first_block}`,
                    `${TopCustomStyle.introduction}`)
                  }
                >
                  <h1
                    className={
                      (`${TopCustomStyle.first_block_sentence}`,
                      `${TopCustomStyle.content_character} col-lg-12 col-sm-12`)
                    }
                  >
                    I'm Tatsuki.
                  </h1>
                  <h1
                    className={
                      (`${TopCustomStyle.first_block_sentence}`,
                      `${TopCustomStyle.content_character} col-lg-12 col-sm-12`)
                    }
                  >
                    This is my portfolio as a
                  </h1>
                  <h1
                    className={
                      (`${TopCustomStyle.first_block_sentence}`,
                      `${TopCustomStyle.content_character} col-lg-12 col-sm-12`)
                    }
                  >
                    software engineer.
                  </h1>
                </div>
              </div>
            </div>
          </Container>
          <Container fluid className={TopCustomStyle.second_block}></Container>
        </div>
      </div>
    </div>
  );
};

export default Top;
